    <style>
        @import url('https://fonts.googleapis.com/css2?family=Montserrat:ital@1&display=swap');

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Montserrat', sans-serif;
        }

        body {
            background-color: black;
        }

        .container-fluid {
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            color: white;
        }

        .text {
            margin: 20px;
            text-align: center;
            font-size: x-large;
        }

        .image-container {
            display: flex;
            justify-content: center;
            align-items: center;
        }

        img {
            border-radius: 50%;
            max-width: 150px;
        }

        a {
            color: white;
            text-decoration: none;
        }

        .start-stop {
            cursor: pointer;
        }

        .video-container {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            background: #333;
            z-index: -1;
        }

            .video-container video {
                min-width: 100%;
                min-height: 100%;
                position: absolute;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
                object-fit: cover;
            }


            .video-container:after {
                content: '';
                z-index: 1;
                height: 100%;
                width: 100%;
                top: 0;
                left: 0;
                background: rgba(0, 0, 0, 0.5);
                position: absolute;
            }
    </style>
